const { default: axios } = require('axios')
const API_URL = require('./api')

class UserService {

    getUser(id) {
        return axios.get(API_URL + "user/" + id);
    }

    updateInterest(interest) {
        return axios.patch(API_URL + "user/user", {
            interest
        });
    }
}

export default new UserService()
